import React from 'react';
import { makeStyles } from "@material-ui/styles";

const styles = makeStyles({
    container: {
        border: "none",
        outline: "none"
    }
});

export default function SlidingPlaceholderInput({ value, placeholder }){
    const classes = styles();
    return (
        <div className = {classes.container}>
            <p>{placeholder}</p>
            <label><input value = {value}/></label>
        </div>
    )
}
